import React from 'react';
import css from './InputValue.module.css';

const InputValue = props => {
    let referance = React.createRef();
    return (
        <>
            <input type={`number`} className={css.inputValue} onChange={referance.current.target}/>
        </>
    );
};

export default InputValue;
